import React from 'react'
import ReactDOM from 'react-dom'

function Nav(){
    return(
        <header>
            <nav>
                <img src="./willamreads.png" />
            </nav>
        </header>
    )
}

function Page(){
    return(
        <>
            <Nav />
        </>
    )
}

ReactDOM.render(<Page />, document.getElementById("root"));
